(1, 1, 1, NULL, '2020-07-27 13:15:29', '2020-09-01 16:51:29', '2d386fc3-cb6e-4841-b70d-7696a4b79234', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 2, 1, 'Home', '2020-07-27 14:09:40', '2020-09-08 19:59:05', '09af2ec6-204e-4723-bd8b-a0a534a14bc3', 'Experiences > Things', 'Opening Friday, October 2nd, in downtown San Antonio, Hopscotch is a uniquely curated, permanent 20,000 sq ft gallery which features 14 distinctive immersive and interactive installations from over 40 local, national and international artists. Exhibitions will rotate over time. Our aim is to elicit a sense of joy and wonder in the spaces we curate, where our guests may participate in a playful manner and explore beyond their day-to-day reality.', 'What people are saying', '[{\"col1\":\"“I walked in weighed down with the week and walked out weightless, it is surprisingly joyful.”\",\"col2\":\"Amy\"},{\"col1\":\"“This uniquely curated immersive art experience was the highlight of our trip to Austin.”\",\"col2\":\"Culture Trip\"},{\"col1\":\"“An amazing experience – an orgasmic stimulation of visual and audio sensory. Bravo.”\",\"col2\":\"Thep\"},{\"col1\":\"“Hopscotch encourages people to put experiences over objects by showcasing unique, interactive experiences throughout the art exhibit.”\",\"col2\":\"The Daily Texan\"},{\"col1\":\"“Seriously one of the coolest places we’ve been to.”\",\"col2\":\"Claire\"},{\"col1\":\"\\\"These exhibits are done by local artists and unlike anything I’ve seen in Austin. Make plans to go as soon as possible.\\\"\",\"col2\":\"365 Things Austin\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 1, 'Home', '2020-07-27 14:09:40', '2020-07-27 14:09:40', '62072998-8bc0-4fbc-bf63-f1d9eba2b20c', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 1, 'About', '2020-08-20 15:05:44', '2020-09-10 01:01:07', '2df1bdbf-4eb8-4b0b-bd6c-4d1244f36a37', NULL, NULL, NULL, NULL, NULL, 'Founded in 2018, Hopscotch is an immersive and experiential brand that brings together artists in collaborative environments to create unique, impactful and distinct shared experiences. We believe art can be a vessel to tell stories and illuminate important messages of the past, present, and future. \n\nHopscotch allows artists to showcase their works in sustainable and creative ways, encourages them be inspired by new mediums and empowers them to reach new audiences (maybe that’s you). We strongly believe in cultivating lasting relationships and a synergy with our staff, artists and the local communities we are in.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
