(85, 414, 1, 'Home', '2020-09-04 15:46:24', '2020-09-04 15:46:24', '25921a78-8ecb-4426-8c44-6bd2981ea9e2', 'Experiences > Things', 'Opening Friday, September 25th in downtown San Antonio, Hopscotch is a uniquely curated immersive and interactive art gallery featuring distinctive installation rooms that showcase works from a variety of artists. We aim to elicit a sense of joy and wonder in the spaces we create, where our guests may explore beyond their day to day reality.', 'What people are saying', '[{\"col1\":\"“I walked in weighed down with the week and walked out weightless, it is surprisingly joyful.”\",\"col2\":\"Amy\"},{\"col1\":\"“This uniquely curated immersive art experience was the highlight of our trip to Austin.”\",\"col2\":\"Culture Trip\"},{\"col1\":\"“An amazing experience – an orgasmic stimulation of visual and audio sensory. Bravo.”\",\"col2\":\"Thep\"},{\"col1\":\"“Hopscotch encourages people to put experiences over objects by showcasing unique, interactive experience throughout the art exhibit.”\",\"col2\":\"The Daily Texan\"},{\"col1\":\"“Seriously one of the coolest places we’ve been to.”\",\"col2\":\"Claire\"},{\"col1\":\"\\\"These exhibits are done by local artists and unlike anything I’ve seen in Austin. Make plans to go as soon as possible.\\\"\",\"col2\":\"365 Things Austin\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
