hy and clean environment for all. The safety and well-being of our guests, staff and the community is of the utmost importance. Click <a href=\"/covid-19\">here</a> to learn more about our COVID-19 guidelines and procedures.</p>', NULL, '[{\"col1\":\"General Public + Ticketing Inquiries\",\"col2\":\"contact@letshopscotch.com\"},{\"col1\":\"Artist, Partnership, Event or Media Inquiries\",\"col2\":\"opportunity@letshopscotch.com\"},{\"col1\":\"Career, Staff, Volunteer or Brand Ambassador Inquiries\",\"col2\":\"join@letshopscotch.com\"}]', 'Hopscotch is for everyone and greatly values diversity. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, disability, or any other protected class.', '<p>“So inventive and fun that I felt like a kid again.” – STACY (HOUSTON, TX)</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
