(128, 820, 1, 'Covid 19', '2020-09-04 21:36:02', '2020-09-04 21:36:02', '8557239c-de8f-48ae-80cc-b1fd2a1e6a6d', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hopscotch is committed to providing a healthy and clean environment for all. The safety and well-being of our guests, staff and the community is of the utmost importance.\n\nAs you prepare to visit please know that guidelines from the City of San Antonio, Bexar County, State of Texas and Centers for Disease Control and Prevention (CDC) will be strictly followed. We have taken enhanced health and safety measures to ensure that we are implementing comprehensive and industry-leading procedures. Continue to visit this page for the most up to date information.', 'If are not feeling well, have tested positive for COVID-19 or feel you have been exposed to someone with COVID-19 please email contact@letshopcotch.com and we will help you reschedule your visit.\n\nBy visiting Hospcotch, you voluntarily assume all risks related to exposure of COVID-19.', NULL, NULL, NULL, NULL),
