(130, 829, 1, 'About', '2020-09-05 01:09:52', '2020-09-05 01:10:32', '2cc952d2-3c54-40b3-aadf-69285781507a', NULL, NULL, NULL, NULL, NULL, 'Hopscotch was founded in 2018 in Austin, TX, with the goal to provide consumers with unique, impactful and distinct immersive experiences. We create spaces for local, national and international artists to showcase their works in sustainable and creative ways, encourage them to be inspired by new mediums and empower them to reach new audiences.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(131, 855, 1, 'Home', '2020-09-08 16:30:19', '2020-09-08 16:30:19', 'abc73522-1f80-4ced-a495-2a68afa001b3', 'Experiences > Things', 'Opening Friday, October 2nd in downtown San Antonio, Hopscotch is a uniquely curated permanent 20,000 sq ft gallery which features 14 distinctive immersive and interactive installations from over 40 local, national and international artists. Exhibitions will rotate over time. Our aim is to elicit a sense of joy and wonder in the spaces we curate, where our guests may participate in a playful manner and explore beyond their day to day reality.', 'What people are saying', '[{\"col1\":\"“I walked in weighed down with the week and walked out weightless, it is surprisingly joyful.”\",\"col2\":\"Amy\"},{\"col1\":\"“This uniquely curated immersive art experience was the highlight of our trip to Austin.”\",\"col2\":\"Culture Trip\"},{\"col1\":\"“An amazing experience – an orgasmic stimulation of visual and audio sensory. Bravo.”\",\"col2\":\"Thep\"},{\"col1\":\"“Hopscotch encourages people to put experiences over objects by showcasing unique, interactive experience throughout the art exhibit.”\",\"col2\":\"The Daily Texan\"},{\"col1\":\"“Seriously one of the coolest places we’ve been to.”\",\"col2\":\"Claire\"},{\"col1\":\"\\\"These exhibits are done by local artists and unlike anything I’ve seen in Austin. Make plans to go as soon as possible.\\\"\",\"col2\":\"365 Things Austin\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(133, 907, 1, 'About', '2020-09-08 16:31:34', '2020-09-08 16:31:34', '80d7552a-f3ba-4439-a3b1-27613ec35de5', NULL, NULL, NULL, NULL, NULL, 'Founded in 2018, Hopscotch is an immersive and experiential brand that brings together artists in collaborative environments to create unique, impactful and distinct shared experiences.  We believe art can be a vessel to tell stories and illuminate important messages of the past, present, and future. \n\nHopscotch allows artists to showcase their works in sustainable and creative ways, encourages them be inspired by new mediums and empowers them to reach new audiences (maybe that’s you). We strongly believe in cultivating lasting relationships and a synergy with our staff, artists and the local communities we are in.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
