(148, 1315, 1, 'Contact', '2020-09-08 17:25:27', '2020-09-08 17:25:27', 'ce73b05a-40c8-4c2f-9212-7a99c3374409', NULL, NULL, NULL, NULL, NULL, NULL, '[{\"col1\":\"711 Navarro, Suite 100\\r\\nSan Antonio, TX 78205\",\"col2\":\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\"}]', 'Hopscotch is located in the Travis Park Plaza Building at 711 Navarro – Main entrance is located on the park side at the corner of Navarro and Travis.', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage, which is adjacent to Hopscotch. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>\n<p><em>Note that validation is not offered for the St. Mary’s Garage which is next to the Travis Park Plaza Garage. Please be sure to enter the correct garage.<br /></em></p>', 'Make it a full day of unique experiences, grab a drink in our lounge, enjoy bites from our food truck and browse local curiosities in our gift shop. Afterward, explore all that downtown San Antonio has to offer.', '<p>Minors under 18 are not allowed without a parent or guardian. Children must be accompanied by an adult at all times during daytime hours. Hopscotch is adult-only after 7:00pm. All guests must be 18+ to enter in the evening. Please visit our <a href=\"/faq\">FAQ</a> page to further plan your visit.</p>', 'We are conveniently located directly across from the Travis Park bus stop. Plan your trip with VIA Metropolitan Transit.', '[{\"col1\":\"Friday\",\"col2\":\"2:00 pm-11:00 pm\",\"col3\":\"(Last ticket 9:30pm)\"},{\"col1\":\"Saturday\",\"col2\":\"11:00 am-11:00 pm\",\"col3\":\"(Last ticket 9:30pm)\"},{\"col1\":\"Sunday\",\"col2\":\"12:00 pm-9:00 pm\",\"col3\":\"(Last ticket 7:30pm)\"}]', 'All gallery tickets must be purchased in advance. You do not need a ticket for our public spaces, which include our lounge, gift shop, patio and food truck.', 'HOW ARE WE RESPONDING TO COVID-19?', '<p>Hopscotch is committed to providing a healthy and clean environment for all. The safety and well-being of our guests, staff and the community is of the utmost importance. Click <a href=\"/covid-19\">here</a> to learn more about our COVID-19 guidelines and procedures.</p>', NULL, '[{\"col1\":\"General Public + Ticketing Inquiries\",\"col2\":\"contact@letshopscotch.com\"},{\"col1\":\"Artist, Partnership, Event or Media Inquiries\",\"col2\":\"opportunity@letshopscotch.com\"},{\"col1\":\"Career, Staff, Volunteer or Brand Ambassador Inquiries\",\"col2\":\"join@letshopscotch.com\"}]', 'Hopscotch is for everyone and greatly values diversity. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, disability, or any other protected class.', '<p>“So inventive and fun that I felt like a kid again.” – <span>STACY (HOUSTON, TX)</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(149, 1316, 1, 'Home', '2020-09-08 17:31:03', '2020-09-08 17:31:03', 'bf89b16d-51e1-4506-a952-a1acd7fc7fd1', 'Experiences > Things', 'Opening Friday, October 2nd, in downtown San Antonio, Hopscotch is a uniquely curated, permanent 20,000 sq ft gallery which features 14 distinctive immersive and interactive installations from over 40 local, national and international artists. Exhibitions will rotate over time. Our aim is to elicit a sense of joy and wonder in the spaces we curate, where our guests may participate in a playful manner and explore beyond their day-to-day reality.', 'What people are saying', '[{\"col1\":\"“I walked in weighed down with the week and walked out weightless, it is surprisingly joyful.”\",\"col2\":\"Amy\"},{\"col1\":\"“This uniquely curated immersive art experience was the highlight of our trip to Austin.”\",\"col2\":\"Culture Trip\"},{\"col1\":\"“An amazing experience – an orgasmic stimulation of visual and audio sensory. Bravo.”\",\"col2\":\"Thep\"},{\"col1\":\"“Hopscotch encourages people to put experiences over objects by showcasing unique, interactive experiences throughout the art exhibit.”\",\"col2\":\"The Daily Texan\"},{\"col1\":\"“Seriously one of the coolest places we’ve been to.”\",\"col2\":\"Claire\"},{\"col1\":\"\\\"These exhibits are done by local artists and unlike anything I’ve seen in Austin. Make plans to go as soon as possible.\\\"\",\"col2\":\"365 Things Austin\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
