(171, 1455, 1, 'Contact', '2020-09-08 20:07:48', '2020-09-08 20:07:48', 'd3b3c1d9-a8ec-469f-a5a4-ad4f7583ff83', NULL, NULL, NULL, NULL, NULL, NULL, '[{\"col1\":\"711 Navarro, Suite 100\\r\\nSan Antonio, TX 78205\",\"col2\":\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\"}]', 'Hopscotch is located in the Travis Park Plaza Building at 711 Navarro – Main entrance is located on the park side at the corner of Navarro and Travis.', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage, which is adjacent to Hopscotch. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>\n<p><em>Note that validation is not offered for the St. Mary’s Garage which is next to the Travis Park Plaza Garage. Please be sure to enter the correct garage.<br /></em></p>', 'Make it a full day of unique experiences, grab a drink in our lounge, enjoy bites from our food truck and browse local curiosities in our gift shop. Afterward, explore all that downtown San Antonio has to offer.', '<p>Minors under 18 are not allowed without a parent or guardian. Children must be accompanied by an adult at all times during daytime hours. Hopscotch is adult-only after 7:00 pm. All guests must be 18+ to enter in the evening. Please visit our <a href=\"/faq\">FAQ</a> page to further plan your visit.</p>', 'We are conveniently located directly across from the Travis Park bus stop. Plan your trip with VIA Metropolitan Transit.', '[{\"col1\":\"Friday\",\"col2\":\"2:00 pm-11:00 pm\",\"col3\":\"(Last ticket 9:30 pm)\"},{\"col1\":\"Saturday\",\"col2\":\"11:00 am-11:00 pm\",\"col3\":\"(Last ticket 9:30 pm)\"},{\"col1\":\"Sunday\",\"col2\":\"12:00 pm-9:00 pm\",\"col3\":\"(Last ticket 7:30 pm)\"}]', 'All gallery tickets must be purchased in advance. You do not need a ticket for our public spaces, which include our lounge, gift shop, patio and food truck.', 'HOW ARE WE RESPONDING TO COVID-19?', '<p>Hopscotch is committed to providing a healthy and clean environment for all. The safety and well-being of our guests, staff and the community is of the utmost importance. Click <a href=\"/covid-19\">here</a> to learn more about our COVID-19 guidelines and procedures.</p>', NULL, '[{\"col1\":\"General Public + Ticketing Inquiries\",\"col2\":\"contact@letshopscotch.com\"},{\"col1\":\"Artist, Partnership, Event or Media Inquiries\",\"col2\":\"opportunity@letshopscotch.com\"},{\"col1\":\"Career, Staff, Volunteer or Brand Ambassador Inquiries\",\"col2\":\"join@letshopscotch.com\"}]', '<p>Hopscotch is for everyone and greatly values diversity. We do not discriminate on the basis of race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, disability or any other protected class.</p>', '<p>“So inventive and fun that I felt like a kid again.” – <span>STACY (HOUSTON, TX)</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(172, 1456, 1, 'Policy', '2020-09-08 20:11:06', '2020-09-08 20:11:06', 'ce8208e6-e04f-4edf-8a1b-209e8547ae60', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ol><li>\n <h4>Our commitment to your privacy</h4>\n <div class=\"policy\">\n \n<p>Hopscotch <em>Hopscotch</em> respects the privacy of every individual visiting Hopscotch’s Website (the <em>Web Site</em>), and recognizes that protecting the privacy and security of the nonpublic personal information we collect about you is an important responsibility. By visiting the Web Site, you agree and accept the practices described in this Privacy Policy, and all applicable laws. The terms in this Privacy Policy are subject to change without notice. By using the Web Site, you expressly consent to our collection, use, storage and disclosure of your information and data as described in this Privacy Policy.</p>\n</div></li>\n <li>\n <h4>KINDS OF INFORMATION COLLECTED BY US</h4>\n <div>\n <p>Nonpublic personal information means the nonpublic information about you that is obtained by\n us in connection with providing you information on some of our products, events and\n services. We may collect nonpublic personal information from you when you visit the Web\n Site.\n </p>\n <p>In general, you can visit our Web Site without telling us who you are or revealing any\n information about yourself. Our Web servers may collect anonymous, aggregated information\n such as when you visited our site, how long you stayed, where you went while you were here\n and if you linked here from another site. Hopscotch aggregates such information to measure\n the use of our Web Site and to improve its content. We may also collect certain information\n about you, such as your IP (Internet Protocol) addresses, domain name, links you clicked on\n to reach the Web Site, and information regarding your operating system and browser when you\n browse the Web Site.</p>\n <p>We may collect nonpublic personal information from you, only if you provide the information\n to us voluntarily. The Web Site provide several opportunities for users to provide personal\n information about themselves to help us provide our users with better service. For example,\n we collect information about you when you send us a request for more information about the\n products, services, and information listed on the Web Site, or if you have a question or\n comment on our Web Site. We also collect information about you when you send an e-mail to\n our webmaster, so that we may respond to your message. We collect no personally identifying\n information about you except when you specifically and knowingly provide it.</p>\n </div>\n </li>\n <li>\n <h4>HOW WE MAY USE AND DISCLOSE YOUR INFORMATION</h4>\n <div>\n <p>Generally, we do not disclose your nonpublic personal information to third parties. However,\n we may disclose aggregated information without your permission. Further, we may use and\n disclose your information both internally and externally, including without limitation, as\n described herein.</p>\n <p>We will not sell your information to any other company however, you should be aware that\n Hopscotch may use this information that you supply about yourself for promotional or\n marketing purposes.</p>\n <p>We will not disclose any nonpublic personal information about our current or former customers\n or consumers to anyone, except as permitted or required by law, or as described below.</p>\n <p>We may disclose all of the information we collect about you to our affiliates and to\n nonaffiliated third-parties that perform services on our behalf, including, but not limited\n to, marketing services, or other financial institutions with whom we have joint marketing\n agreements.</p>\n <p>If we collect nonpublic personal information from you to provide third-party financial\n products and services requested by you, such third-party’s use of your personal information\n will be subject to their privacy policy as disclosed to you by them.</p>\n <p>We sometimes engage third parties, such as contractors, to provide certain operational\n services to us or on our behalf. We may share your information with those third parties on a\n need to know basis. In addition, we may enter into certain marketing relationships with\n third parties to provide you with better service. We may share some of your nonpublic\n personal information with those parties. However, you are under no obligation to respond to\n any requests from those third parties.</p>\n </div>\n </li>\n <li>\n <h4>HOW YOU CAN OPT-OUT, ACCESS, UPDATE, OR DELETE YOUR INFORMATION</h4>\n <div>\n <p>You can see, review and change your information by sending a request to\n webmaster@letshopscotch.com. At any time, you may also request us to delete your information by\n sending us an email at webmaster@letshopscotch.com Although, we will make every effort to delete\n your information from our databases, and inform third-parties to whom we have provided a\n link on the Web Site to do the same, we may need to retain your information in our archives\n and records in order to comply with law, resolve disputes, troubleshoot problems, assist\n with investigations, enforce our Web Site Terms of Use, and other policies, and take other\n actions otherwise permitted by law.</p>\n </div>\n </li>\n <li>\n <h4>HOW WE PROTECT YOUR INFORMATION</h4>\n <div>\n <p>We have procedures in place that limit access to nonpublic personal information to those\n employees and other individuals who need to know such information to provide products and\n services to you. We will maintain physical, electronic, and procedural safeguards to protect\n the confidentiality of your nonpublic personal information as required by law. However, such\n precautions do not guarantee the absolute safety of your data, and Hopscotch makes no\n guarantees, warranties or representation that your information is protected from viruses and\n other security attacks. Further, while Hopscotch follows appropriate procedures to ensure\n that third parties will keep your information secure, Hopscotch cannot make any guarantees\n with respect to the actions or policies of such third parties.</p>\n </div>\n </li>\n <li>\n <h4>LINKS ON OUR WEBSITE</h4>\n <div>\n <p>Our privacy policies apply only to your use of the Web Site. The Web Site contains links to\n other sites. We are not responsible for the privacy practices of those sites, even if they\n bear our logo and name. Links to other sites do not imply an endorsement of the materials or\n policies on those Web Sites. You should read the privacy policies of each site you visit to\n determine what information that site may be collecting about you.</p>\n </div>\n </li>\n <li>\n <h4>USE OF COOKIES</h4>\n <div>\n <p>When you visit the Web Site, Hopscotch places a cookie in the browser files of your computer.\n A cookie is a file that tracks what you do on the Web Site. Our cookie does not collect any\n personally identifying information about you. We use the information it collects for\n administrative purposes and to understand how visitors use our site. The majority of Web\n browsers accept cookies, but the help menu on your browser should give you options for\n preventing, accepting, or receiving notice of new cookies. However, please be aware that if\n you block cookies, some Web site functionality may be lost. You consent to the placement of\n cookies on your hard drive when you visit the Web Site.</p>\n </div>\n </li>\n <li>\n <h4>GENERAL</h4>\n <div>\n <p>Users should be aware that Hopscotch has no control over any information that users may\n disclose to other users of the Web Site. Please notify Hopscotch immediately if you discover\n that any user of the Web Site is improperly collecting or using personally identifying\n information of users of the Web Site.</p>\n <p>We know that online security is a serious matter. At Hopscotch, we consider your online\n security an important factor of our commitment to overall customer satisfaction. For\n additional information on your privacy rights concerning data collected by Web sites, refer\n to the Federal Trade Commission’s How to Protect Your Privacy pamphlet.</p>\n <p>This Privacy Policy will be updated periodically and posted on the Web Site. It applies to\n the online practices of Hopscotch and its divisions. References to Hopscotch, we, us and our\n are references to Hopscotch and its respective divisions and affiliates. We reserve the\n right to change or update this Privacy Policy at any time, without notice, by posting\n revisions on the Web Site. You agree to review the Privacy Policy each time you use the Web\n Site so that you are aware of any modifications. By accessing or using the Web Site, you\n agree to be bound by all of the terms and conditions of this Privacy Policy as posted at the\n time of your access or use.</p>\n <p>This Privacy Policy is incorporated by reference in and is a part of the Web Site Terms of\n Use agreement. If you have any questions or comments about this Privacy Policy please\n contact Hopscotch at webmaster@letshopscotch.com</p>\n <p>This Privacy Policy is effective as of April 2020.</p>\n </div>\n </li>\n </ol>', NULL, NULL, NULL, NULL, NULL, NULL),
(173, 1457, 1, 'Covid 19', '2020-09-08 20:15:21', '2020-09-08 20:15:21', '9b27ee32-df53-409b-919a-ce8714fc2498', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hopscotch is committed to providing a healthy and clean environment for all. The safety and well-being of our guests, staff and the community is of the utmost importance.\n\nAs you prepare to visit, please know that guidelines from the City of San Antonio, Bexar County, State of Texas, and Centers for Disease Control and Prevention (CDC) will be strictly followed. We have taken enhanced health and safety measures to ensure that we are implementing comprehensive and industry-leading procedures. Continue to visit this page for the most up-to-date information.', 'If are not feeling well, have tested positive for COVID-19 or feel you have been exposed to someone with COVID-19, please email contact@letshopscotch.com and we will help you reschedule your visit.\n\nBy visiting Hopscotch, you voluntarily assume all risks related to exposure to COVID-19.', NULL, NULL, NULL, NULL);
