INSERT INTO `matrixcontent_covidguidelines` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_guideline_guidelineHeader`, `field_guideline_guidelineContent`) VALUES
(1, 127, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', '26307e9d-0ce6-4f1f-91ff-8fc84220ef9d', 'ALL STAFF AND GUESTS MUST WEAR PROPER FACE COVERINGS AND BE TEMPERATURE SCREENED', 'Guests are not allowed entry without proper face coverings and must keep them on throughout the experience. Anyone refusing to wear a face covering will be asked to leave the show. Temperatures will be checked at the door and must be below 100.4 degrees to enter.'),
(2, 128, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', '8741ca3d-35b5-4872-8bb7-51a89b1becf0', 'SOCIAL DISTANCING WILL BE ENFORCED', 'Guests must adhere to proper social distancing guidelines while at Hopscotch. Signage, ground markings and staff will enforce proper social distancing. Plexiglass barriers are placed in close contact areas. Separate entrance and exits limit guest interaction. We also have a large outdoor patio space available to enjoy food and beverages while practicing social distancing.'),
(3, 129, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', 'b01058c1-e726-4262-b8e5-d54d2436b729', 'LIMITED VENUE HOURS AND 25% CAPACITY STRICTLY ENFORCED', 'We offer dedicated pre-ticketed time slots for a continually safe guest flow. If you are visiting one of our public non-ticketed gallery areas, you will be asked to wait if we are at capacity.'),
(4, 130, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', 'a10498ff-7fdb-4c8f-862b-ab93d2dd2726', 'LIMITED TOUCHPOINTS', 'No cash; all transactions are debit and credit card only. Tap to pay is available. Guests may use their phones to sign the waiver. Self-cleaning film has been added to all high-touch spots.'),
(5, 131, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', 'b51e42f9-5492-451c-93fd-79dbe6641fe6', 'ALL SURFACES AND TOUCHPOINTS WILL BE SANITIZED REGULARLY', 'In addition to professional, nightly deep cleans, our staff will be trained in COVID-19 safety and will be frequently cleaning surfaces throughout their shifts.'),
(6, 132, 1, '2020-09-01 19:05:28', '2020-09-04 21:36:02', '3d8bad21-b197-4e7e-8464-05eef0e2baad', 'TEN TOUCHLESS HAND SANITIZING STATIONS THROUGHOUT THE VENUE', 'Please avoid touching your eyes, nose and mouth. Please regularly use our many hand sanitizer stations that are available throughout the experience.'),
(7, 133, 1, '2020-09-01 19:05:28', '2020-09-08 20:15:21', 'd50ca710-fbdf-488f-9947-3c92db95aa02', 'FREQUENTLY CIRCULATED AND PURIFIED AIR', 'Our air is continually ventilated throughout the space at all times. We have ultraviolet lights and specialized filters installed inside our HVAC system to provide purified air throughout the entire building. Automated decontamination systems are also placed throughout the space, dispensing antimicrobial vapor.'),
(8, 135, 1, '2020-09-01 19:05:28', '2020-09-01 19:05:28', '9f970774-17b4-48d3-8ec6-aed3e51aa917', 'ALL STAFF AND GUESTS MUST WEAR PROPER FACE COVERINGS AND BE TEMPERATURE SCREENED', 'Guests are not allowed entry without proper face covering and must keep them on throughout the experience. Anyone refusing to wear a face covering will be asked to leave the show. Temperatures will be checked at the door and must be below 100.4 degrees to enter.'),
(9, 136, 1, '2020-09-01 19:05:28', '2020-09-01 19:05:28', '8b60e509-e008-4205-9ac0-ba02b9490040', 'SOCIAL DISTANCING WILL BE ENFORCED', 'Guests must adhere to proper social distancing guidelines while at Hopscotch. Signage, ground markings and staff will enforce proper social distancing. Plexiglass barriers are placed in close contact areas. Separate entrance and exits limit guest interaction. We also have a large outdoor patio space available to enjoy food and beverage on while practicing social distancing.'),
