(93, 1575, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', '2bf6cb14-6ebf-4226-8e6f-232a8a14c426', 'ALL GUESTS AND STAFF WILL BE TEMPERATURE SCREENED', 'Temperatures will be checked at the main and employee entrances and must be below 100.4 degrees to enter.'),
(94, 1576, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', '72071f2f-307f-458b-9dda-da05a8dbcc32', 'STATE OF THE ART AIR DECONTAMINATION', 'Potent antimicrobial systems which employ state-of-the-art atomization technology to facilitate rapid generation and dispersion of antimicrobial vapors are placed throughout the space to decontaminate the air. These systems constantly combat and destroy harmful pathogens if they are present in the environment and provide safe and effective disinfection.'),
(95, 1577, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', 'cc7d5d28-02a2-41da-8522-9491932984a9', 'LIMITED TOUCHPOINTS', 'No cash; all transactions are debit and credit card only. Tap to pay is available. Guests may use their phones to sign the waiver. Self-cleaning film has been added to all high-touch spots.'),
(96, 1578, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', 'eff59687-e07e-47a0-9a0a-d0ef309c79ab', 'SURFACES AND TOUCHPOINTS WILL BE SANITIZED REGULARLY', 'In addition to professional, nightly deep cleans, our staff will be trained in COVID-19 safety and will be frequently cleaning surfaces throughout their shifts.'),
(97, 1579, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', 'eec93704-611a-4ae5-9cbc-ce4cacbc6055', 'TEN TOUCHLESS HAND SANITIZING STATIONS THROUGHOUT THE VENUE', 'Please regularly use our many hand sanitizer stations that are available throughout the experience and avoid touching your eyes, nose and mouth.'),
(98, 1580, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', '6e84a9c4-4e23-4537-ac7f-5f6035d99770', 'SOCIAL DISTANCING WILL BE ENFORCED', 'Our air is continually ventilated throughout the space at all times. We have ultraviolet lights and specialized filters installed inside our HVAC system to provide purified air throughout the entire building. Automated decontamination systems are also placed throughout the space, dispensing antimicrobial vapor.'),
(99, 1581, 1, '2020-09-08 22:02:10', '2020-09-08 22:02:10', '83c65da0-9444-4d27-9a53-dffdb8567085', 'LIMITED VENUE HOURS AND 25% CAPACITY STRICTLY ENFORCED', 'We offer dedicated pre-ticketed time slots for a continually safe guest flow. If you are visiting one of our public, non-ticketed gallery areas, you will be asked to wait if we are at capacity.'),
