(103, 1590, 1, '2020-09-09 21:02:24', '2020-09-09 21:02:24', 'c406852b-4845-4331-b5d1-8ea55330c399', 'STATE OF THE ART AIR DECONTAMINATION', 'Potent antimicrobial systems which employ state-of-the-art atomization technology to facilitate rapid generation and dispersion of antimicrobial vapors are placed throughout the space to decontaminate the air. These systems constantly combat and destroy harmful pathogens if they are present in the environment and provide safe and effective disinfection.'),
