INSERT INTO `matrixcontent_faqquestions` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_faqs_faqQuestion`, `field_faqs_faqAnswer`) VALUES
(1, 174, 1, '2020-09-03 00:11:44', '2020-09-03 00:14:05', '802890bb-98df-4a2c-a769-160762000ef5', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(2, 175, 1, '2020-09-03 00:11:44', '2020-09-03 00:14:05', '6eb6360c-f84d-450c-95e5-34ffe9ecadeb', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(3, 184, 1, '2020-09-03 00:11:44', '2020-09-03 00:11:44', 'a66855d8-52bb-4516-a40f-a976c0571f72', 'Where are you located?', '<p>We are located in the Travis Park Plaza Building at 711 Navarro. Please visit our Contact page for more information.</p>'),
(4, 185, 1, '2020-09-03 00:11:44', '2020-09-03 00:11:44', '70ac5e8f-2805-4a42-b228-7aa91d1664c6', 'What are your hours?', '<p>Please visit our Contact page to view our hours of operation.</p>'),
(5, 186, 1, '2020-09-03 00:14:05', '2020-09-04 21:14:50', 'ca85e6f4-b2ce-49fd-af87-99dbd1fcecad', 'Where do I park? Is it free?', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>'),
(6, 195, 1, '2020-09-03 00:14:05', '2020-09-03 00:14:05', '0f1f9696-fa9f-4f0e-9dc3-c18cdf98a764', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(7, 196, 1, '2020-09-03 00:14:05', '2020-09-03 00:14:05', '6c0fb933-768d-458c-9b62-c3b9529de1af', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(8, 197, 1, '2020-09-03 00:14:05', '2020-09-03 00:14:05', '61725350-0ca9-4e2a-b085-d9678530b82a', 'Where do I park? Is it free?', '<p>Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>'),
(9, 199, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'dd30a706-fce2-4e40-9c69-1c225b031c39', 'How much are tickets?', '<p>$24 for Adults (13 - 59) <br />$20 for Seniors, Veterans, Teachers, Healthcare Workers &amp; Students <br />(Must show valid ID)<br />$15 for Children (4-12)<br />$0 for Children (0-3)</p>\n\n\n\n'),
(10, 200, 1, '2020-09-03 00:21:51', '2020-09-04 21:14:50', 'b5358942-2039-493b-953c-ee187cb06dae', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID-19 restrictions you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(11, 201, 1, '2020-09-03 00:21:51', '2020-09-04 21:14:50', '739b8a9a-45a9-4447-b1a1-f2dc0e81c794', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket. Please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(12, 202, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '4d89b8ad-541b-4e1c-b941-c28c5fc82acc', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(13, 203, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '286f6e0c-e279-4712-9304-25180062f45e', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(14, 204, 1, '2020-09-03 00:21:51', '2020-09-04 21:14:50', 'cd85e37c-2f12-4f97-8f79-cdcd7ed4aafa', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(15, 205, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'de52a166-a4d6-4f06-a059-f379139ec45e', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(16, 206, 1, '2020-09-03 00:21:51', '2020-09-04 21:14:50', '52740018-2b7f-40be-b2b5-fff839de8dea', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(17, 207, 1, '2020-09-03 00:21:51', '2020-09-04 21:14:50', 'e7d324a1-3afc-4936-ab1a-c0c6b9cb82ab', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter the public space as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(18, 208, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '55673afe-d36b-48b5-85dd-0da112e4b070', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(19, 217, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '5c604ae3-8128-42f6-a17c-52bc88397d9f', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(20, 218, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '81ab17ac-1e3a-481e-90a9-a76c6a7d5948', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(21, 219, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '45285158-92c1-42db-abf8-d001ee12befa', 'Where do I park? Is it free?', '<p>Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>'),
(22, 221, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'fbb8b2c8-ddee-4a21-b0d6-8be3c6ec8254', 'How much are tickets?', '<p>$24 for Adults (13 - 59) <br />$20 for Seniors, Veterans, Teachers, Healthcare Workers &amp; Students <br />(Must show valid ID)<br />$15 for Children (4-12)<br />$0 for Children (0-3)</p>\n\n\n\n'),
(23, 222, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '75aa1e05-b459-47e7-99d8-6d83eb92fd67', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID restrictions you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(24, 223, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '269428ba-ae30-4d26-b4cb-922adeca0d9a', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket, please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(25, 224, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '4c6527c2-7c5d-45ca-b695-4b3f08665fcd', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(26, 225, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'a04920a9-e796-4386-b0bc-822d1c80ef99', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(27, 226, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '12669820-dea0-426a-9c26-24b77bd00224', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(28, 227, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'bac1894a-8c83-48f4-87b8-fe0af80f208c', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(29, 228, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '6f3f9024-13bb-4d2e-9cd1-8384b7aeac90', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(30, 229, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', 'f88263fd-50e7-4925-83cf-05d62fe753b1', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(31, 230, 1, '2020-09-03 00:21:51', '2020-09-03 00:21:51', '52a64cc5-50bd-4606-9c15-ca165a66a784', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(32, 232, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'c5fc479a-34cd-49da-9eee-15c504d063c4', 'How long is the gallery experience?', '<p>It varies for each guest; we recommend spending at least an hour so that you have time to explore each different installation. Afterward, explore our gift shop and stay to talk about your experience over some great local food and beverage on our patio.</p>'),
(33, 233, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'ecf3f9ee-ba97-45e1-9c61-4def4f414776', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(34, 234, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '22cecf55-c30a-409e-88e1-99ba26a82911', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>'),
(35, 235, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '78c2586b-4540-4595-b9c5-20d02326ab0d', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(36, 236, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '89288f4a-6569-4cb1-af35-233e5befa81e', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability please contact us at curate@letshopscotch.com.</p>'),
(37, 237, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '3bd9748c-dd22-45ff-bcc6-81af955fdbde', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(38, 238, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'bb76c2a5-566e-4cf6-a9a6-a0262ff66bc8', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(39, 240, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '30aa6ab2-3248-4a80-b9a5-7afd1ceca14b', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.</p>'),
(40, 241, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '03ebf3b5-c7bd-477c-b53d-9f7cf977609a', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(41, 242, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '33c04804-7b34-4cd3-b764-4fee92952199', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(42, 243, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'a3f2aaa4-4989-4a44-b307-211067cc656c', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(43, 244, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '25bfdbc2-55ae-4b54-8cad-cb55dea47ed0', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(44, 246, 1, '2020-09-03 13:46:25', '2020-09-04 21:14:50', 'c1ae8ce8-8382-45f4-8248-b41ef03e4cf6', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(45, 247, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'cea85d13-a8b0-4c20-806f-3f236f5597e2', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(46, 248, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '67f1eee0-9e42-4c8b-9cc7-7fc0f9022204', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(47, 250, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'd1d80ca7-9e06-48f3-968c-6f63b59b5374', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(48, 251, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'b05b764f-eaa9-4ab1-855c-290b5fa0789c', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(49, 252, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'afb4aaae-835a-4c67-acc7-e09634b0ec0c', 'How long is this here for?', '<p>Hopscotch is here to stay! This is a permanent location rather than a short term exhibition.</p>'),
(50, 253, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '4234afd4-b7d6-4c41-8996-7cba6c7d9647', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(51, 254, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '970f62b9-5803-4a50-b7da-d904ab10398d', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(52, 263, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '87f72ebf-d36f-40bb-9817-7131c6e76d23', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(53, 264, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', 'bedb91f4-6ea9-4f00-b173-0ac40a1a4a0d', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(54, 265, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '3c28024f-010f-45ab-bb0a-000da71cabd3', 'Where do I park? Is it free?', '<p>Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>'),
(55, 267, 1, '2020-09-03 13:46:25', '2020-09-03 13:46:25', '63d044d2-44bc-475e-b56c-52fa5d8fb5ac', 'How much are tickets?', '<p>$24 for Adults (13 - 59) <br />$20 for Seniors, Veterans, Teachers, Healthcare Workers &amp; Students <br />(Must show valid ID)<br />$15 for Children (4-12)<br />$0 for Children (0-3)</p>\n\n\n\n'),
