(86, 480, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '4afa678c-375d-438a-82b3-b77db11addc0', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(87, 481, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:05', '51e10dad-a823-43ee-9f1e-65d50d3917d1', 'Where do I park? Is it free?', '<p>Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your <a href=\"/about\">validation</a>. </p>'),
(88, 483, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'f675ad2c-d9ae-4d80-a3a5-aba79f5e1c80', 'How much are tickets?', '<p>$24 for Adults (13 - 59) <br />$20 for Seniors, Veterans, Teachers, Healthcare Workers &amp; Students <br />(Must show valid ID)<br />$15 for Children (4-12)<br />$0 for Children (0-3)</p>\n\n\n\n'),
(89, 484, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'a91f841d-1cd9-44c6-92b6-6ccad4be8913', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID restrictions you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(90, 485, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '11d385b8-c299-4b28-a255-585b1acb813a', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket, please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(91, 486, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'fb7273d7-4d6e-4a5e-b98b-bbc4e09a5f68', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(92, 487, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '8cc3a01a-a919-4d77-9a3c-ae60282a83de', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(93, 488, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '524c95c5-23a3-40eb-9bc8-0b6b384d44ee', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(94, 489, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '73a9f406-20a2-4fa5-9ee4-9ac19b53b827', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(95, 490, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'be14676a-9f27-4e37-b451-08513e48ea56', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(96, 491, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'aa2e5c02-5ab8-4ffc-a086-500a2245f96f', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(97, 492, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'd1fe0c77-a669-46af-b574-1c0053e350cd', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(98, 494, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'aea73a7e-228d-4c61-b0e9-8d97c61dfe44', 'How long is the gallery experience?', '<p>It varies for each guest; we recommend spending at least an hour so that you have time to explore each different installation. Afterward, explore our gift shop and stay to talk about your experience over some great local food and beverage on our patio.</p>'),
(99, 495, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '992fba19-5400-4837-87c1-e5b4ece9ec30', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(100, 496, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '1943c0f5-5d11-4675-b0fc-f0f14d57d618', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>'),
(101, 497, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '880621d2-655f-48ba-b01e-c4bb5ce6f56c', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(102, 498, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '64ae029b-2a43-4c90-9852-1d60923a04d6', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability please contact us at curate@letshopscotch.com.</p>'),
(103, 499, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '8ffe6379-d2f9-4b87-8fcb-d659c12b33a6', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(104, 500, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'e8a05a44-77f3-41c0-abb3-41050100a1df', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(105, 502, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '39163c04-9536-4cbd-81de-0f5242e92a24', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.</p>'),
(106, 503, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '0a964b4d-33c3-431f-8244-1583ff63897c', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(107, 504, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '6efdd8ae-877c-404d-ab2a-5f9adfaf7302', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(108, 505, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '73928f2c-66c5-4d15-9311-02d1e0c01720', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(109, 506, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'b21b3511-26fd-4072-984b-65de2ad58f04', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(110, 508, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'bbfe2d75-e318-497f-9d60-43039940eb60', 'What are your health and safety procedures?', '<p>Please visit our COVID page.</p>'),
(111, 509, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', 'cfdb9e37-4672-4d64-994a-4f11df6e90cb', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(112, 510, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', '70e82359-c3f1-40a1-820a-778f214fa6d2', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(113, 512, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', '283d6323-fe82-48c0-a4de-ba99699ecd2e', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(114, 513, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', '6f0298fa-dde6-453d-98f7-19fefb07c1c0', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(115, 514, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', 'b2c16259-9cb7-4e12-ba67-8f799fd5bb25', 'How long is this here for?', '<p>Hopscotch is here to stay! This is a permanent location rather than a short term exhibition.</p>'),
(116, 515, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', '6d01b108-a5cc-4be3-8015-1a947533bde4', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(117, 516, 1, '2020-09-04 15:58:05', '2020-09-04 15:58:05', 'e377b58c-a746-4cff-a5ad-6be1c3eb3f99', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(118, 520, 1, '2020-09-04 16:32:07', '2020-09-04 16:32:07', '52174c6e-0206-414e-8da9-65ac648184e4', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(119, 521, 1, '2020-09-04 16:32:07', '2020-09-04 16:32:07', '910324a4-9cf1-4226-a4d0-4f1ee86716c7', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
