(149, 556, 1, '2020-09-04 16:32:08', '2020-09-04 16:32:08', 'b83a5253-d032-4d47-b946-c1d116af34b9', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(150, 557, 1, '2020-09-04 16:32:08', '2020-09-04 16:32:08', '33825036-94f7-4578-8762-c31f865aed50', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(151, 560, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', '9f1008ab-30dd-4485-9173-a55d71ff3cff', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(152, 561, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', '83191032-f44c-4aff-b10c-c0490e853477', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(153, 562, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'edd8969c-a653-47ae-a6e8-a8c13383ab30', 'Where do I park? Is it free?', '<p>Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.</p>'),
(154, 564, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'fab75a7b-4c49-4ede-9714-ac3b12fe3123', 'How much are tickets?', '<p>$24 for Adults (13 - 59) <br />$20 for Seniors, Veterans, Teachers, Healthcare Workers &amp; Students <br />(Must show valid ID)<br />$15 for Children (4-12)<br />$0 for Children (0-3)</p>\n\n\n\n'),
(155, 565, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'c9878f8e-c9cb-49a4-9e53-89737ae64bf0', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID restrictions you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(156, 566, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'c8556abc-ef12-46d7-8386-00c12ccb655e', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket, please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(157, 567, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', '99cd6d31-990a-4e1d-b75e-358fa2121eba', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(158, 568, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'f1c95c5f-f682-4813-b37d-001f7a0c72c7', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(159, 569, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', '852e8869-3f3f-4c6c-813b-b1c764c186a8', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(160, 570, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'cbec6f5c-ae2c-4f68-b020-0ab19366b083', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(161, 571, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'aec22f57-f5f3-4838-97bf-0dac97ee071f', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(162, 572, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'b8ce3330-479d-45b6-9628-b3db3975dde3', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(163, 573, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'f37ca18c-ee6d-44de-94c9-7b23faa224f5', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(164, 575, 1, '2020-09-04 16:32:34', '2020-09-04 16:32:34', 'f46203be-3f73-4ba7-ae24-da6e7b1afe53', 'How long is the gallery experience?', '<p>It varies for each guest; we recommend spending at least an hour so that you have time to explore each different installation. Afterward, explore our gift shop and stay to talk about your experience over some great local food and beverage on our patio.</p>'),
(165, 576, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', 'e217171f-0698-4f38-b448-d3fa7594da84', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(166, 577, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', 'bf83a9b9-3aac-4f38-afb2-71de25be0864', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>'),
(167, 578, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '9903c216-fac7-4ffd-8f17-5ae0bcefca71', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(168, 579, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '8ca43648-bde1-4699-ae01-2069d495d726', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability please contact us at curate@letshopscotch.com.</p>'),
(169, 580, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '71167afc-7900-451e-981b-d15f43841ef4', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(170, 581, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', 'fa259d3f-45fa-4dad-b18a-c3451612b446', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(171, 583, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', 'ffa7bedb-8e69-43f5-bdc9-f44ba4f1e467', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.</p>'),
(172, 584, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', 'd191573a-e520-40a0-90b2-7ac0b05b11c5', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(173, 585, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '58f5d8c9-96fd-408b-98d1-29905b9cd3c3', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(174, 586, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '2fe7401f-e7bf-43b0-9178-7e40887e5f2b', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(175, 587, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '0dc34ca4-7b23-49f8-91e4-66fee7369cf8', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(176, 589, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '8dd80145-6d15-4082-afc7-28cc7f5e2447', 'What are your health and safety procedures?', '<p>Please visit our COVID page.</p>'),
(177, 590, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '86b8dd73-c63f-429d-b205-df4ab0a316c0', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(178, 591, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '2169f975-c774-4d2a-a8a4-f3cf7e8da90c', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(179, 593, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '6ea67c15-7775-4e71-84d5-a4d267aec0a6', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(180, 594, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '6ff21091-d473-4bfe-a090-b3db88052ce2', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(181, 595, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '8cbc5f5a-5f62-450a-9deb-c5c0fbfffb32', 'How long is this here for?', '<p>Hopscotch is here to stay! This is a permanent location rather than a short term exhibition.</p>'),
(182, 596, 1, '2020-09-04 16:32:35', '2020-09-04 16:32:35', '466560d7-6233-4661-ab81-b127575bf295', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
