(212, 808, 1, '2020-09-04 21:14:50', '2020-09-04 21:14:50', '52482d1b-b376-488d-82a3-bb68a5eceaa8', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(213, 809, 1, '2020-09-04 21:14:50', '2020-09-04 21:14:50', '013fc5fa-7cd4-4363-8293-81169abdea5e', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(214, 810, 1, '2020-09-04 21:14:50', '2020-09-04 21:14:50', '849ddd88-821b-4db6-89b7-8365e37b7565', 'How long is this here for?', '<p>Hopscotch is here to stay! This is a permanent location rather than a short term exhibition.</p>'),
(215, 811, 1, '2020-09-04 21:14:50', '2020-09-04 21:14:50', 'fd6a3ea3-2bbe-4d31-9504-3326268b3fb3', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(216, 812, 1, '2020-09-04 21:14:50', '2020-09-04 21:14:50', 'e18e1aff-6199-45bc-bf9d-6179e2692b0e', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(250, 1197, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', 'cda655e5-e277-4b40-8ae0-2d9c189629a6', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. The main entrance is located on the park side at the corner of Navarro and Travis. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(251, 1198, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', 'c3190d73-840f-4ad6-a060-4efea35acf00', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(252, 1199, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '63682e79-2629-41e8-90f6-173b19881480', 'Where do I park? Is it free?', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage which is adjacent to Hopscotch. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation. Please note that validation is not offered for the St. Mary’s Garage which is next to the Travis Plaza Garage, please be sure to pay attention to signage so that you park in the correct garage.</p>'),
(253, 1201, 1, '2020-09-08 17:09:16', '2020-09-08 20:16:39', 'bac12f36-4252-4c9a-adcc-08c25cc6a16a', 'How much are tickets?', '<p>Friday-Sunday<br /></p>\n<p>GA Adults: $24<br />Students, Seniors, and Military ID-Holders: $20<br />(Must show valid ID)<br />Children (Ages 4-13): $15<br />Children 3 and under are free</p>\n<p>Hopscotch is adult only after 7:00 pm, the last available time to purchase children’s tickets is 6:00 pm. </p>'),
(254, 1202, 1, '2020-09-08 17:09:16', '2020-09-08 17:36:59', 'a2dbbbc8-ebd6-433e-b3ac-12f07db3a9ba', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID-19 restrictions, you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(255, 1203, 1, '2020-09-08 17:09:16', '2020-09-08 17:36:59', '1fc29747-2c42-446d-a3a3-b1b6bf136755', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of but cannot be guaranteed. You do not need to print your ticket. Please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(256, 1204, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '467c4f91-74d2-48c9-bbe1-c673b6b505e8', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(257, 1205, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '6f6cfd21-7450-4e2d-bc9e-274e17a4f37c', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(258, 1206, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', 'dfadc34e-dc18-4772-b9ac-8c9a4ed4b1be', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(259, 1207, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '381f98cd-4ad7-43d0-97ab-2551e2de58ba', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(260, 1208, 1, '2020-09-08 17:09:16', '2020-09-08 17:36:59', '954a01cd-c771-4001-adf9-28ee0c3e4290', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside, you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(261, 1209, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '8b787a90-f7d4-40d2-b355-ee039eea70e8', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter the public space as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(262, 1210, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', 'b75d6951-addf-48b4-96d5-3afd22839524', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(263, 1212, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', 'e35fbe2f-da31-4886-93a9-31bc86df10f4', 'How long is the gallery experience?', '\n<p>You may stay and explore as long as you like. Most guests spend 60-90 minutes on average in the gallery portion of the experience. </p>\n'),
(264, 1213, 1, '2020-09-08 17:09:16', '2020-09-08 17:36:59', '3d7d73c0-f97f-49c2-aea6-29c1cf7da595', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00 pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(265, 1214, 1, '2020-09-08 17:09:16', '2020-09-08 20:16:39', '0c7fafe5-4196-4d39-812a-a0ff8318b6b0', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>\n<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find our food truck on our patio.</p>'),
(266, 1215, 1, '2020-09-08 17:09:16', '2020-09-08 17:09:16', '9732ff90-8bc8-4cb5-8cb5-81cd47f826d8', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(267, 1216, 1, '2020-09-08 17:09:16', '2020-09-08 17:36:59', '748b173b-2914-483b-839c-d6cfa0b0aaea', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability, please contact us at opportunity@letshopscotch.com.</p>'),
(268, 1217, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '73282fe9-9f10-401a-b5ef-4302cb67af3d', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(269, 1218, 1, '2020-09-08 17:09:17', '2020-09-08 17:36:59', 'a69f5587-ad0f-4182-9d57-729ad90f69c2', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space, so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(270, 1220, 1, '2020-09-08 17:09:17', '2020-09-08 17:36:59', '25b12144-657e-41e0-9fed-87badfe528dd', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove, we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience, we recommend that you carry as little as possible.</p>'),
(271, 1221, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '9c7fe918-7519-402d-8fb5-f359284383b8', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(272, 1222, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '79b4947d-e6c7-4286-b7a3-fcf853388877', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(273, 1223, 1, '2020-09-08 17:09:17', '2020-09-08 17:36:59', '0cfbf888-22a9-4042-a1ef-0e6e7ee16e05', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you carry as little as possible as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(274, 1224, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', 'd6aa6e90-6c43-4aa5-8145-2c4613fa2248', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(275, 1226, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '09f29da0-6801-4a1c-94a0-f1c9876e2b5b', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(276, 1227, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '5322548a-5b6a-42e5-9bf4-a67cfde69a0d', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(277, 1228, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', 'd5a8271f-e851-47b4-a919-47ea0b5dbc69', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(278, 1230, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '3257999e-82f1-4384-a249-a6790f2b3b6b', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(279, 1231, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', '1530466b-65e0-45c2-8953-19ba8038a3e3', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(280, 1232, 1, '2020-09-08 17:09:17', '2020-09-08 17:09:17', 'cc337044-1175-4abb-84a2-f9c2301bbea0', 'How long is this here for?', '\n<p>Hopscotch is here to stay! This is a permanent gallery with rotating exhibitions. </p>\n'),
(281, 1233, 1, '2020-09-08 17:09:17', '2020-09-08 20:16:39', 'ee11042a-5ff1-44e8-9bc5-14b18dcc951f', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
