(298, 1254, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'fa8108ab-d7e4-471f-b6da-0e4f38d52d97', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '\n<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>\n<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You find our Food Truck on our patio.</p>\n'),
