(301, 1257, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '02619055-c0a9-4594-8a0f-b0c14711fbf6', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(302, 1258, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '301b006e-0596-43ad-9bb0-6d8df4d760a3', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(303, 1260, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'd38ed4d9-e64d-4932-8d9d-03df2b049781', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.</p>'),
(304, 1261, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'f40c5397-0c22-431a-911b-422ff1aa5353', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(305, 1262, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '7dde237d-6c0a-4964-9460-458fde27f445', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>');
INSERT INTO `matrixcontent_faqquestions` (`id`, `elementId`, `siteId`, `dateCreated`, `dateUpdated`, `uid`, `field_faqs_faqQuestion`, `field_faqs_faqAnswer`) VALUES
(306, 1263, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '47987cc0-e278-4e75-99bd-72c086a975e9', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(307, 1264, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '14a20a49-23c9-41f9-bc42-f371021858c6', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(308, 1266, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '70346b2b-f7c1-4c1e-bbfb-9a64aa0f550a', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(309, 1267, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '5022902e-520b-4c61-a013-cca43743e726', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(310, 1268, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'c0c83893-2e1f-4987-8206-1ebf49942dd7', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(311, 1270, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'a544066b-eeca-48bd-9a48-c2cb4d4dbf95', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(312, 1271, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '5f8acc7c-bce0-44d6-a89c-96e11835e2f3', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(313, 1272, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', '75a7cbd4-670e-46af-80f8-1caa4ad92d80', 'How long is this here for?', '\n<p>Hopscotch is here to stay! This is a permanent gallery with rotating exhibitions. </p>\n'),
(314, 1273, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'fa90984d-4c09-43c1-8d5a-eaf191fe04d2', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(315, 1274, 1, '2020-09-08 17:09:18', '2020-09-08 17:09:18', 'e225a635-966e-400b-90b9-273563f26361', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(316, 1277, 1, '2020-09-08 17:23:54', '2020-09-08 17:23:54', 'be9aaeaf-cda0-4c1a-8f7a-09b5d469b180', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. The main entrance is located on the park side at the corner of Navarro and Travis. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(317, 1278, 1, '2020-09-08 17:23:54', '2020-09-08 17:23:54', '04d01c49-a178-48dd-bfc9-9488d52e5513', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(318, 1279, 1, '2020-09-08 17:23:54', '2020-09-08 17:23:54', '70ae8f83-4c42-4934-ab10-db42742b1bf6', 'Where do I park? Is it free?', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage which is adjacent to Hopscotch. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation. Please note that validation is not offered for the St. Mary’s Garage which is next to the Travis Plaza Garage, please be sure to pay attention to signage so that you park in the correct garage.</p>'),
(319, 1281, 1, '2020-09-08 17:23:54', '2020-09-08 17:23:54', '6867b702-713c-42f2-9040-77141d4f7af3', 'How much are tickets?', '<p>Friday-Sunday<br /></p>\n<p>GA Adults: $24<br />Students, Seniors, and Military ID-Holders: $20<br />(Must show valid ID)<br />Children (Ages 4-13): $15<br />Children 3 and Under are Free</p>\n<p>Hopscotch is adult only after 7:00pm,the last available time to purchase children’s tickets is 6:00pm. </p>'),
(320, 1282, 1, '2020-09-08 17:23:54', '2020-09-08 17:23:54', 'e804e75b-7ee1-4c26-9ea6-084a444d9c4d', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID-19 restrictions you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(321, 1283, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '4f858bd9-cdb2-43c8-997b-2017af73db1b', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket. Please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(322, 1284, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '16689074-8825-41db-8afb-5ca76b77ffd6', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(323, 1285, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '1a1d2226-3f22-490d-ba60-091056f3c82c', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(324, 1286, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '7a1ba0ca-d3d2-4dfa-abaf-42b500127300', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(325, 1287, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'a5fc56ba-b56b-4ba8-948e-f0d5e2fec9dd', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(326, 1288, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '9135db96-f150-4d5d-a46d-54fbc757a445', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(327, 1289, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '471752f9-4c3c-4ee8-9fea-47a3a7d46b7f', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter the public space as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(328, 1290, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'dd8afad4-a377-45a2-88ce-ed487edc03ef', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(329, 1292, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '9c68c49b-01a2-4821-bcc3-8ac87d0ebf07', 'How long is the gallery experience?', '\n<p>You may stay and explore as long as you like. Most guests spend 60-90 minutes on average in the gallery portion of the experience. </p>\n'),
(330, 1293, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '36ef1fad-173e-48d3-9dab-4b03a6e4f57b', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(331, 1294, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '9825f978-5fe5-4b43-b166-5088aaec1de0', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '\n<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>\n<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You find our Food Truck on our patio.</p>\n'),
(332, 1295, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'a8cf0a79-2c12-466c-b6b5-75a71e7db9af', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(333, 1296, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '0aa39699-ca58-49ec-be61-0c4f8c09f898', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability please contact us at opportunity@letshopscotch.com.</p>'),
(334, 1297, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '63b46e48-f404-44e4-839a-ee81977290d4', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(335, 1298, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'e5edfe32-c49b-4634-9e4a-de9757df7ad2', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(336, 1300, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'f3639557-80d0-448e-9559-9fe249339af8', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.</p>'),
(337, 1301, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '9fe2b90b-f3b7-4631-a00e-d5ffef5002e4', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(338, 1302, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'e4b01b18-fd1a-4923-8bf9-d0833d51bf4b', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(339, 1303, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '9076dd4b-8197-4a61-a21d-dd9e68170a05', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(340, 1304, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '6cc35daa-1c72-4acc-9f1b-475067f3716f', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(341, 1306, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'c4327d8e-ccf3-4481-9019-cbaced2cb377', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(342, 1307, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', '36701a51-8c19-4920-950e-400b6ae612ea', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(343, 1308, 1, '2020-09-08 17:23:55', '2020-09-08 17:23:55', 'a9a6537e-e751-4375-b254-c430075cb231', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
