(358, 1356, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '5bbb24a0-e556-458c-b80d-4c56ab890511', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
