(365, 1364, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '1a7f3006-cddc-439d-99b2-c3d0ff6628e3', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(366, 1365, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '26f6e67f-b371-462f-874e-9d7ff5ce1d7f', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability, please contact us at opportunity@letshopscotch.com.</p>'),
(367, 1366, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', 'd6e67d44-6062-4ce0-bc83-d677b469eab1', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(368, 1367, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '28822d12-9bec-4f81-b890-eb640caa06cf', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space, so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(369, 1369, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '841c8e66-a3b3-4023-bf22-243b8bf086a3', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove, we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience, we recommend that you carry as little as possible.</p>'),
(370, 1370, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '4a29d02f-6674-459f-ace3-c24fd18d6217', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(371, 1371, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', 'b354e2e7-2288-47c9-9933-465a37437b85', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(372, 1372, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '6bd97a44-e190-48be-b245-0ab7a888a3da', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you carry as little as possible as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(373, 1373, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '4b918e64-3627-429f-a452-584719c51718', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(374, 1375, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '0e568d3f-9be7-4de1-b2dd-8d432010f2d9', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(375, 1376, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '1084d5f1-be42-4df3-80f1-bdd1399d702e', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(376, 1377, 1, '2020-09-08 17:36:59', '2020-09-08 17:36:59', '1373c6e2-3fb2-498c-bf74-5f7dfdd2752a', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(377, 1379, 1, '2020-09-08 17:37:00', '2020-09-08 17:37:00', 'e7a26249-def4-46c3-b1ce-3b3aab6012c4', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(378, 1380, 1, '2020-09-08 17:37:00', '2020-09-08 17:37:00', 'a1bc80dc-6bef-45a0-8534-e712a286fd26', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(379, 1381, 1, '2020-09-08 17:37:00', '2020-09-08 17:37:00', '2a615d69-3b9a-4537-879e-70afde6711e5', 'How long is this here for?', '\n<p>Hopscotch is here to stay! This is a permanent gallery with rotating exhibitions. </p>\n'),
(380, 1382, 1, '2020-09-08 17:37:00', '2020-09-08 17:37:00', 'fadc77cd-5369-4c50-a58a-1f0b567b9ee5', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(381, 1383, 1, '2020-09-08 17:37:00', '2020-09-08 17:37:00', '6ba3b880-aef4-4339-b7be-c96a12c957cc', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>'),
(382, 1467, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'a57cb6f0-95a3-4add-a371-f9922693c8b7', 'Where are you located?', '<p>We are located in the <a href=\"https://www.google.com/maps/place/711+Navarro+St+%23100,+San+Antonio,+TX+78205/@29.4281272,-98.4928058,17z/data=!3m1!4b1!4m5!3m4!1s0x865c5ff7e300eb3d:0xd24083b65785019e!8m2!3d29.4281272!4d-98.4906118\" target=\"_blank\" rel=\"noreferrer noopener\">Travis Park Plaza Building at 711 Navarro</a>. The main entrance is located on the park side at the corner of Navarro and Travis. Please visit our <a href=\"/contact\">Contact</a> page for more information.</p>'),
(383, 1468, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '763779bf-82df-4318-8d32-6c300c726c44', 'What are your hours?', '<p>Please visit our <a href=\"/contact\">Contact</a> page to view our hours of operation.</p>'),
(384, 1469, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '64609db1-a432-4957-9e9d-fcba86ade1f7', 'Where do I park? Is it free?', '<p>Three-hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage which is adjacent to Hopscotch. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation. Please note that validation is not offered for the St. Mary’s Garage which is next to the Travis Plaza Garage, please be sure to pay attention to signage so that you park in the correct garage.</p>'),
(385, 1471, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '763acb86-f31b-44c4-88e3-14aebef27e26', 'How much are tickets?', '<p>Friday-Sunday<br /></p>\n<p>GA Adults: $24<br />Students, Seniors, and Military ID-Holders: $20<br />(Must show valid ID)<br />Children (Ages 4-13): $15<br />Children 3 and under are free</p>\n<p>Hopscotch is adult only after 7:00 pm, the last available time to purchase children’s tickets is 6:00 pm. </p>'),
(386, 1472, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '3f4a6912-40a4-4c5a-859d-c68f2daaced1', 'Do I have to have a ticket to enter?', '<p>You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID-19 restrictions, you may experience wait times to enter the public spaces if we are at capacity.</p>'),
(387, 1473, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'd365e4bd-5057-4d1b-8d58-92b1f7e42160', 'Can I buy tickets at the door?', '<p>We highly recommend purchasing tickets in advance. Limited tickets may be available day-of but cannot be guaranteed. You do not need to print your ticket. Please bring your electronic copy that was emailed to you at time of purchase.</p>'),
(388, 1474, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'e00b8b53-df6b-47c1-801d-3bff683d4013', 'Can I pay in cash?', '<p>As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.</p>'),
(389, 1475, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '6010b09b-fa14-4a53-aaa9-2002b771bd8d', 'Do I have to sign a waiver?', '<p>All guests must sign a waiver online before entering or at our check-in desk upon entering the space.</p>'),
(390, 1476, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'f89d64e0-a9b5-450e-ad5d-71060933ce61', 'Can I transfer my ticket?', '<p>Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).</p>'),
(391, 1477, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '65500c9d-d2bd-4c12-9297-cee79480c2a5', 'What time do I need to arrive for my timed ticket?', '<p>You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.</p>'),
(392, 1478, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '92ac6cf8-73b9-4690-80c7-61f6f8813a2a', 'What do I need for check in?', '<p>Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside, you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!</p>'),
(393, 1479, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'f30ad8e1-d3c2-45a5-877a-41663daaffe9', 'Can I leave and come back in?', '<p>If you are following our safety guidelines, you may enter the public space as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.</p>'),
(394, 1480, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'f691caba-562b-4bad-9308-e8d00aadccdc', 'Can I change my ticket time or get a refund?', '<p>All ticket sales are final. Tickets are non-refundable and non-transferable.</p>'),
(395, 1482, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '373a43ca-6ad4-4c53-8a1c-601cf31f5029', 'How long is the gallery experience?', '\n<p>You may stay and explore as long as you like. Most guests spend 60-90 minutes on average in the gallery portion of the experience. </p>\n'),
(396, 1483, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '91952e95-5619-4e56-b97d-4cf309feef81', 'Is Hopscotch for all ages?', '<p>Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00 pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!</p>'),
(397, 1484, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'd51c46dc-6b96-43f7-a345-7c0a0f2e16e7', 'Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?', '<p>Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.</p>\n<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find our food truck on our patio.</p>'),
(398, 1485, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '4f98da3e-0db3-459b-bacb-2f97cb9cf0d8', 'Do you sell food and beverages at Hopscotch?', '<p>We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.</p>'),
(399, 1486, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '0cde8950-46db-4e9f-b085-0d923f375cd7', 'Can I book a group outing or event?', '<p>We are strictly following safety restrictions on group outings. To discuss options, pricing and availability, please contact us at opportunity@letshopscotch.com.</p>'),
(400, 1487, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'f23b7100-b060-499a-83f3-3173ce1c3b7b', 'Are there any rules about taking photos?', '<p>We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.</p>'),
(401, 1488, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'e080d952-317d-401a-b199-b2b41776ec1b', 'Do you sell Hopscotch merchandise and other gifts?', '<p>Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space, so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.</p>'),
(402, 1490, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'cbf3dfd2-51c4-4669-8fb0-0426cf79d75d', 'Is there somewhere to store strollers and other items?', '<p>Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove, we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience, we recommend that you carry as little as possible.</p>'),
(403, 1491, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '0c827388-694f-48c5-8cf5-de03954426a5', 'Are there bathrooms?', '<p>Yes, we have easily accessible bathrooms available for you to use at any time.</p>'),
(404, 1492, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '09c80c63-5fa9-4cd7-8746-838537e6384f', 'Are pets allowed?', '<p>No. Pets, unfortunately, are not allowed. We do allow service animals.</p>'),
(405, 1493, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'd0178a5b-0485-4581-81b5-1a2c01cc7a3d', 'Is there a lost and found?', '<p>Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you carry as little as possible as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.</p>'),
(406, 1494, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '167ae43f-41fa-44fe-bf7f-2ddbf0af1c73', 'Are you ADA accessible?', '<p>Yes, Hopscotch is ADA accessible.</p>'),
(407, 1496, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '7ace8bf9-dd37-4dab-a7bb-a8f4889779be', 'What are your health and safety procedures?', '<p>Please visit our <a href=\"{entry:11@1:url||http://hopscotch.heyblackmagic.com/covid-19}\" target=\"_blank\" rel=\"noreferrer noopener\">COVID-19</a> page.</p>'),
(408, 1497, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '761fd419-f6a7-420a-8cef-1f3fc0ff4677', 'Can I wear a costume?', '<p>We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.</p>'),
(409, 1498, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'ea51edd2-8ef8-452b-8d88-4ef9a4c85afe', 'Do you allow weapons?', '<p>We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.</p>'),
(410, 1500, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', 'c8960a64-6e6c-456d-9d55-e4e07f7a8e3c', 'What is Hopscotch?', '<p>Read more about us on our <a href=\"/about\">About</a> page.</p>'),
(411, 1501, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '3b14f26d-81a6-4612-952b-0cc6d3a552a0', 'Who curated the experience?', '<p>This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.</p>'),
(412, 1502, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '1527af64-d159-4ba1-8ef8-9ca757f0e972', 'How long is this here for?', '\n<p>Hopscotch is here to stay! This is a permanent gallery with rotating exhibitions. </p>\n'),
(413, 1503, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '4723d43d-a842-4c96-a173-26af453a30ef', 'I’m visiting from out of town, where should I stay?', '<p>Email contact@letshopscotch.com and we will send you a list of our favorite hotels in the area!</p>'),
(414, 1504, 1, '2020-09-08 20:16:39', '2020-09-08 20:16:39', '1b9d3441-c332-47ed-a8a8-6851eb024522', 'How can I become part of the Hopscotch team?', '<p>Please email us at join@letshopscotch.com</p>');
