(55, 472, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'aefaa76e-6567-4112-97f7-205ca4833b2f', 'The Basics', '[{\"col1\":\"Where are you located?\",\"col2\":\"We are located in the Travis Park Plaza Building at 711 Navarro. Please visit our Contact page for more information.\"},{\"col1\":\"What are your hours?\",\"col2\":\"Please visit our Contact page to view our hours of operation.\"},{\"col1\":\"Where do I park? Is it free?\",\"col2\":\"Three hour validated parking will be provided for all guests who park in the Travis Park Plaza Garage. Enter off of Travis Street between Navarro and St. Mary’s. Bring your parking ticket with you and show it to Hopscotch staff to receive your validation.\"}]'),
(56, 473, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'dfa2fc5d-e8b4-4489-bb0e-48329a430f70', 'TICKETING AND ADMISSION', '[{\"col1\":\"How much are tickets?\",\"col2\":\"$24 for Adults (13 - 59)\\r\\n$20 for Seniors, Veterans, Teachers, Healthcare Workers & Students (Must show valid ID)\\r\\n$15 for Children (4-12)\\r\\n$0 for Children (0-3)\"},{\"col1\":\"Do I have to have a ticket to enter?\",\"col2\":\"You do not have to have a ticket for our public lounge, gift shop, patio or food truck spaces. You will need a ticket to enter our gallery space. Due to COVID restrictions you may experience wait times to enter the public spaces if we are at capacity.\"},{\"col1\":\"Can I buy tickets at the door?\",\"col2\":\"We highly recommend purchasing tickets in advance. Limited tickets may be available day-of, but can not be guaranteed. You do not need to print your ticket, please bring your electronic copy that was emailed to you at time of purchase.\"},{\"col1\":\"Can I pay in cash?\",\"col2\":\"As part of our ongoing safety measures, Hopscotch is now cashless. All guests must pay via credit or debit card for all purchases.\"},{\"col1\":\"Do I have to sign a waiver?\",\"col2\":\"All guests must sign a waiver online before entering or at our check-in desk upon entering the space.\"},{\"col1\":\"Can I transfer my ticket?\",\"col2\":\"Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable).\"},{\"col1\":\"What time do I need to arrive for my timed ticket?\",\"col2\":\"You are welcome to arrive early to enjoy a beverage from our lobby lounge or purchase bites from our food truck. You may enter the gallery no earlier than 15 minutes prior to your scheduled ticket time. If you arrive 30 minutes after your purchased time slot, you will not be guaranteed access into the gallery.\"},{\"col1\":\"What do I need for check in?\",\"col2\":\"Please bring your photo ID and an electronic copy of your ticket. Tickets are non-refundable and non-transferrable. One person\'s ID in your party must match the name on one ticket (the rest of the names are interchangeable). Once inside you’ll sign a required liability waiver and get a brief orientation on how best to experience Hopscotch!\"},{\"col1\":\"Can I leave and come back in?\",\"col2\":\"If you are following our safety guidelines, you may enter as long as we aren’t capacity. You will not be able to re-enter the gallery space once you have exited.\"},{\"col1\":\"Can I change my ticket time or get a refund?\",\"col2\":\"All ticket sales are final. Tickets are non-refundable and non-transferable.\"}]'),
(57, 474, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '5c87e645-0ca5-417c-b273-e91c15faacfd', 'THE EXPERIENCE', '[{\"col1\":\"How long is the gallery experience?\",\"col2\":\"It varies for each guest; we recommend spending at least an hour so that you have time to explore each different installation. Afterward, explore our gift shop and stay to talk about your experience over some great local food and beverage on our patio.\"},{\"col1\":\"Is Hopscotch for all ages?\",\"col2\":\"Hopscotch welcomes all audiences, though some installations may be more adult-focused than others. Children under the age of 18 must be accompanied by an adult at all times. Guests under 18 are not allowed after 7:00pm. Many installations are more about looking or listening than touching, so we ask that adults supervise accordingly. Wall text and our staff are there to guide you through to ensure you experience everything in the best way possible!\"},{\"col1\":\"Can I bring food and beverages into Hopscotch? Do you sell food and beverages at Hopscotch?\",\"col2\":\"Outside food or beverages may not be brought into Hopscotch. There are drinking fountains and a hydration station should you wish to bring a refillable water bottle. We also have bottles available for purchase.\"},{\"col1\":\"Do you sell food and beverages at Hopscotch?\",\"col2\":\"We have a full menu of alcoholic and non-alcoholic beverages available in our lounge that you can purchase to walk with throughout our space or sit down to enjoy after your experience. You can find the Smack’s Chicken Shack food truck on our patio.\"},{\"col1\":\"Can I book a group outing or event?\",\"col2\":\"We are strictly following safety restrictions on group outings. To discuss options, pricing and availability please contact us at curate@letshopscotch.com.\"},{\"col1\":\"Are there any rules about taking photos?\",\"col2\":\"We want you to have fun and enjoy yourself in every moment. Please take as many photos as you like, but also please be considerate of others enjoying the exhibit. We also encourage you to put your phone away at times to fully immerse yourself in the experience. Tripods, excessive props, costume changes, commercial or product shoots, media shoots, press interviews, and all professional video equipment are prohibited without advance approval and accompaniment from a Hopscotch representative. Contact us at opportunity@letshopscotch.com for requests. We are committed to working with and giving back to nonprofit groups in the communities we create in. We strive to support as many local artists and non-profit groups as possible.\"},{\"col1\":\"Do you sell Hopscotch merchandise and other gifts?\",\"col2\":\"Yes! We have a gift shop full of unique curiosities that we encourage you to explore. Our retail area is part of our public space that is open to the public so you don\'t need a ticket to visit. There are no returns or exchanges on gift shop items.\"}]'),
(58, 475, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '5f350e4b-1d7f-49ba-8435-8f9f6ce4e393', 'ACCESSIBILITY', '[{\"col1\":\"Is there somewhere to store strollers and other items?\",\"col2\":\"Strollers and large bags will not be allowed into the experience. We will have a small storage area in our lobby that you may check items at if you took public transit. If you drove we kindly ask that you leave large items in your vehicle. In order to fully enjoy the experience we recommend that you be as hands-free as possible.\"},{\"col1\":\"Are there bathrooms?\",\"col2\":\"Yes, we have easily accessible bathrooms available for you to use at any time.\"},{\"col1\":\"Are pets allowed?\",\"col2\":\"No. Pets, unfortunately, are not allowed. We do allow service animals.\"},{\"col1\":\"Is there a lost and found?\",\"col2\":\"Please be extra diligent in holding on to your belongings, particularly cell phones. In order to fully enjoy the experience we recommend that you be as hands free as possible and leave extra items in your vehicle. We can not guarantee that all lost items will be found and are not responsible for missing items. Please email contact@letshopscotch.com to inquire about a missing item.\"},{\"col1\":\"Are you ADA accessible?\",\"col2\":\"Yes, Hopscotch is ADA accessible.\"}]'),
(59, 476, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', 'e57cb91a-024a-4d95-8621-ef57b2a554c7', 'SAFETY', '[{\"col1\":\"What are your health and safety procedures?\",\"col2\":\"Please visit our COVID page.\"},{\"col1\":\"Can I wear a costume?\",\"col2\":\"We love uniqueness and creativity more than anyone. What we don’t love are costumes that obscure your face, have accessories or are culturally inappropriate. Our staff will have the right to refuse you entry if we find you to be in violation of this policy.\"},{\"col1\":\"Do you allow weapons?\",\"col2\":\"We absolutely do not allow any firearms, knives, weapons or illegal substances of any kind.\"}]'),
(60, 477, 1, '2020-09-04 15:58:04', '2020-09-04 15:58:04', '35e70e7b-8cfb-4457-aa0c-c63d573eb3b3', 'GENERAL', '[{\"col1\":\"What is Hopscotch?\",\"col2\":\"Read more about us on our About page.\"},{\"col1\":\"Who curated the experience?\",\"col2\":\"This experience was curated by Hopscotch. We are committed to creating unique, immersive art experiences that are a respite from the outside world and invoke a sense of joy and wonder in our guests. We strive to engage with and support local, national and international artists and give them a platform that allows them to showcase their works.\"},{\"col1\":\"How long is this here for?\",\"col2\":\"Hopscotch is here to stay! This is a permanent location rather than a short term exhibition.\"},{\"col1\":\"I’m visiting from out of town, where should I stay?\",\"col2\":\"Email contact@letshoshopscotch.com and we will send you a list of our favorite hotels in the area!\"},{\"col1\":\"How can I become part of the Hopscotch team?\",\"col2\":\"Please email us at join@letshopscotch.com\"}]');
